def hex_to_int(hex_str):
	int_value = int(hex_str, 16)
	return int_value


def mds_matrix_int(matrix):
	row = len(matrix)
	col = len(matrix[0])
	result = [[0] * col for i in range(row)]

	for i in range(row):
		for j in range(col):
			result[i][j] = hex_to_int(matrix[i][j])
	
	return result


